import React from 'react';
import './HomePage.css';

function getStoreData() {
    this.setState({
        loading: true
    }, () => {
        fetch("http://localhost:3001/products").then(res => res.json()).then(result => this.setState({
            loading: false,
            products: result
        })).catch(console.log);
    });
}



export const HomePage = () => {


    return(
        <div className="home-page">
            {getStoreData()}
        </div>
    )
}
